package arland;

/**
 * @author xiangchaolei
 */
public class IsSubsequence {

    public boolean isSubsequence(String s, String t) {

        boolean[][] dp = new boolean[s.length()+1][t.length()+1];

        for (int i = 0; i < t.length(); i++) {
            dp[0][i] = true;
        }

        for (int i = 1; i <= t.length(); i++) {
            for (int j = 1; j <= s.length(); j++) {
                if(s.charAt(j-1)==t.charAt(i-1)){
                    dp[j][i] = dp[j-1][i-1];
                }
                else{
                    dp[j][i] = dp[j][i-1];
                }
            }
        }

        return dp[s.length()][t.length()];
    }

    public static void main(String[] args) {
        // write your code here
        String s1="abc";
        String t1="ahbgdc";

        String s2="axc";
        String t2="ahbgdc";

        String s3="leeeeetcode";
        String t3="";

        String s4="leeeeetcode";
        String t4="";

        IsSubsequence a = new IsSubsequence();
        System.out.println(a.isSubsequence(s1,t1));
        System.out.println(a.isSubsequence(s2,t2));
        System.out.println(a.isSubsequence(s3,t3));
        System.out.println(a.isSubsequence(s4,t4));
    }
}
